package hashset;

import java.util.HashSet;

public class CreateHashSet {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		HashSet<String> hs = new HashSet<String>();
		hs.add("Alpha");
		hs.add("Beta");
		hs.add("Gamma");
		hs.add("Lambda");
		hs.add("Theta");
		
		System.out.println(hs);

	}

}
